  -H 'x-language: en' \
  -H 'x-operation-name: SportBet_SportMarketOutcome' \
  -H 'x-operation-type: query' \
  --data-raw '{"query":"query SportBet_SportMarketOutcome($outcomeId: String!, $provider: SportsbookOddsProviderEnum!) {
  sportMarketOutcome(outcomeId: $outcomeId, provider: $provider) {
    id
    name
